import ClearCarPromo from './components/ClearCarPromo';
import LoginForm from './components/LoginForm';

function App() {
  return (
    <div className="min-h-screen bg-white flex">
      {/* Left Section - Login Form */}
      <div className="w-1/2 p-8 flex flex-col">
        <div className="mb-12">
          <img src="/acv-logo.svg" alt="ACV Logo" className="h-8" />
        </div>
        <LoginForm />
      </div>

      {/* Right Section - ClearCar Promotion */}
      <div className="w-1/2 bg-gray-50 p-8 flex items-center">
        <ClearCarPromo />
      </div>
    </div>
  );
}

export default App;
